import React from 'react'
import './Logo.less'

export default function Logo () {
    return (
        <div className="logo-container">
            <img alt="logo" className="https://i.ytimg.com/vi/gQ2N7fzrS9E/hqdefault.jpg" />
        </div>
    )
}
